const Title = ({className, title}) => {
  const classTitle = className ? `${className}__title` : 'title'
  switch (title.priority) {
    case '6': return (
      <h6 className={classTitle}>
        {title.data}
      </h6>
    )
    case '5': return (
      <h5 className={classTitle}>
        {title.data}
      </h5>
    )
    case '4': return (
      <h4 className={classTitle}>
        {title.data}
      </h4>
    )
    case '3': return (
      <h3 className={className ? `${className}__title` : 'title'}>
        {title.data}
      </h3>
    )
    case '2': return (
      <h2 className={className ? `${className}__title` : 'title'}>
        {title.data}
      </h2>
    )
    default: return (
      <h1 className={className ? `${className}__title` : 'title'}>
        {title.data}
      </h1>
    )
  }
}

export default Title
